The serial by EAT that most packages contain doesn't work any more, if it ever did. It makes the info box say &quot;Pro&quot;, but if you use the Pro features (like for instance create bookmarks) and save, the document still gets watermarked.

Note that this serial is good for all version 2.xxx AFAIK. There shouldn't be any need to install the program if you already have it installed. I've successfully used the serial on several versions that earlier had the EAT serial. So just take the serial and try it if you already have a version 2.xxx.
